function initDatatable() {
	var table = $('table.members-table').DataTable({
		"bInfo": false,
		"lengthChange": false,
		"autoWidth": false,
		"paging": false,
		"sortable": true,
		"scrollCollapse": true,
		"scrollY": '610px',
		search: {
			minLength: 1
		},
		"iDisplayLength": 7,
		"order": [[0, "asc"]]
	});

	$('#sort-select').on('change', function () {
		var column = parseInt($(this).val());
		var order = table.order()[0][1];
		table.order([column, order]).draw();
	});

	$("#search-control").on('keyup', function () {
		table.search(this.value).draw();
	});
}

// animation aos
function initAOS() {
	setTimeout(function () {
		AOS.init({
			duration: 1000,
			once: true
		});
		window.addEventListener('load', function () {
			AOS.refresh();
		});
	}, 100);
}

function initReviewExpanded() {
	$('.tile-staff .btn').on('click', function (e) {
		e.preventDefault();
		var $button = $(this);
		var $tileStaff = $button.closest('.tile-staff');

		if ($tileStaff.hasClass('show')) {
			$button.text('Read More');
			$tileStaff.removeClass('show');
		} else {
			var $otherTileStaff = $('.tile-staff.show');
			if ($otherTileStaff.length > 0) {
				$otherTileStaff.removeClass('show');
				$otherTileStaff.find('.btn').text('Read More');
			}
			$tileStaff.addClass('show');
			$button.text('Read Less');
		}
	});

}

function initCountdown() {
	function countdown(endDate, elementId) {
		const countDownDate = new Date(endDate).getTime();
		const timer = setInterval(function () {
			const now = new Date().getTime();
			const distance = countDownDate - now;

			const years = Math.floor(distance / (1000 * 60 * 60 * 24 * 365));
			const months = Math.floor((distance % (1000 * 60 * 60 * 24 * 365)) / (1000 * 60 * 60 * 24 * 30));
			const days = Math.floor((distance % (1000 * 60 * 60 * 24 * 30)) / (1000 * 60 * 60 * 24));
			const hours = Math.floor((distance % (1000 * 60 * 60 * 24)) / (1000 * 60 * 60));

			const yearWord = years === 1 ? 'year' : 'years';
			const monthWord = months === 1 ? 'month' : 'months';
			const dayWord = days === 1 ? 'day' : 'days';
			const hourWord = hours === 1 ? 'hour' : 'hours';

			const countdownElement = document.getElementById(elementId);

			if (countdownElement) {
				countdownElement.innerHTML = `
				<div class="countdown-item">
					<span class="countdown-value">${years.toString().padStart(2, '0')}</span>
					<span class="countdown-label">${yearWord}</span>
				</div>
				<div class="countdown-item">
					<span class="countdown-value">${months.toString().padStart(2, '0')}</span>
					<span class="countdown-label">${monthWord}</span>
				</div>
				<div class="countdown-item">
					<span class="countdown-value">${days.toString().padStart(2, '0')}</span>
					<span class="countdown-label">${dayWord}</span>
				</div>
				<div class="countdown-item">
					<span class="countdown-value">${hours.toString().padStart(2, '0')}</span>
					<span class="countdown-label">${hourWord}</span>
				</div>
				`;

				if (distance < 0) {
					clearInterval(timer);
					countdownElement.innerHTML = "EXPIRED";
				}
			}
		}, 1000);
	}

	countdown('2050-01-01', 'countdown');
}

// Header scroll init
function headerScrollUp() {
	var lastScrollTop = $(window).scrollTop();
	$(window).on('scroll', function (event) {
		var st = $(window).scrollTop();
		if (st > lastScrollTop && st > $('.header').innerHeight()) {
			$('.header').addClass('header--hidden');
		} else {
			$('.header').removeClass('header--hidden');
		}
		lastScrollTop = st;

		if (st > 0) {
			$('.header').addClass('header--fixed');
		} else {
			$('.header').removeClass('header--fixed');
		}
	});
}

// initialize custom form elements (checkbox, radio, select) https://github.com/w3co/jcf
function jcfInit() {
	var customSelect = $('select');
	var customCheckbox = $('input[type="checkbox"]');
	var customRadio = $('input[type="radio"]');

	// all option see https://github.com/w3co/jcf
	jcf.setOptions('Select', {
		wrapNative: false,
		wrapNativeOnMobile: false,
		fakeDropInBody: false,
		maxVisibleItems: 6
	});

	jcf.setOptions('Checkbox', {});

	jcf.setOptions('Radio', {});

	// init only after option
	jcf.replace(customSelect);
	jcf.replace(customCheckbox);
	jcf.replace(customRadio);

}

// smart menu init
function initSmartMenu() {
	var distanceBetweenMenuAndNav = $(".header-menu-wrapper").offset().top + $(".header-menu-wrapper").innerHeight() - $(".nav").offset().top - $(".nav").innerHeight();
	$(".header-menu").smartmenus({
		collapsibleBehavior: "accordion",
		mainMenuSubOffsetY: distanceBetweenMenuAndNav
	});

	// changed date attribute to a class (need to reverse last item menu)
	$('.header-menu').children().last().addClass('nav-sm-reverse');

	$("body").mobileNav({
		menuActiveClass: "nav-active",
		menuOpener: ".nav-opener",
		hideOnClickOutside: true,
		menuDrop: ".nav-drop"
	}), "ontouchstart" in document.documentElement ||
		$(window).on("resize orientationchange", function () {
			$("body").removeClass("nav-active"), $.SmartMenus.hideAll();
		});
}

